import React from 'react';
import NavbarExplore from './NavbarExplore';
import Popular from './Popular';
import Navbar1 from '../Navbar1';
import '../App.css';
function Explore() {
	return (
		<div>
			<Navbar1 />
			<NavbarExplore />
			<section className="bg-light" style={{ minHeight: 700 }}>
				<Popular />
			</section>
		</div>
	);
}
export default Explore;
